function Knowledge() {
    
    return(
        <div id="experience" className="">
            <h2>Knowledge</h2>
            <h3>Languages</h3>
            <ul className="list-group">
                <li className="list-group-item">C# (C Sharp)</li>
                <li className="list-group-item">JS (JavaScript)</li>
            </ul>
                <li className="list-group-item">Exp</li>
                <li className="list-group-item">Certs</li>                
        </div>
    )
}//end method

export default Knowledge;
